import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Spinner from 'react-bootstrap/Spinner';
import { NotFound } from ".";
import util from "../util";

function VolHome() {

  const navigate = useNavigate();

  const [data, setData] = useState(null);
  const [error, setError] = useState(null);
  const [loaded, setLoaded] = useState(false);

  useEffect(() => {
    renderVolunteer();
  });

  function renderVolunteer() {
    // do not re-render if data already rendered
    if (data != null || error != null)
      return;

    util.requestGET('/causes_api/get_user').then(res => {
      if (res.status === 200) {
        res.json().then(body => {
          if ('volunteer' in body) {
            const volData = body['volunteer'];

            setLoaded(true);
            setData(volData);
          } else {
            navigate('/orghome');
          }
        });
      } else if (res.status === 401) {
        navigate('/');
      } else {
        setLoaded(true);
        setError(404);
      }
    });
  }

  return (
    <div>
      {data &&
        <div className="home">
          <div className="volinfo">
            <h1>{ data.name }</h1>
            <p>{ data.bio }</p>
          </div>
          <div className = "Events">
          <div class="card">
            <h5 class="card-header">Organizations</h5>
            <div class="card-body">
              <h5 class="card-title">California Bail Reform</h5>
              <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
              <a href="#" class="btn btn-primary">View Org Page</a>
            </div>
            <div class="card-body">
              <h5 class="card-title">California Bail Reform</h5>
              <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
              <a href="#" class="btn btn-primary">View Org Page</a>
            </div>
          </div>
          <div class="card">
            <h5 class="card-header">Events</h5>
            <div class="card-body">
              <h5 class="card-title">March for Awareness</h5>
              <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
              <a href="#" class="btn btn-primary">View Event Page</a>
            </div>
            <div class="card-body">
              <h5 class="card-title">March for Awareness</h5>
              <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
              <a href="#" class="btn btn-primary">View Event Page</a>
            </div>
          </div>
          </div>
        </div>
      }
      {!loaded &&
        <div className="my-3">
          <Spinner animation="border" variant="primary" />
        </div>
      }
      {error === 404 &&
        <NotFound />
      }
    </div>
  );
}

export default VolHome;
